import React from "react";
import { Container, Row, Col } from "react-bootstrap";

function Footer() {
  return (
    <footer>
      <Container className="color-foot">
        <Row>
            <Col className="text-center py-3">Copyright &copy; Max Kreerenko</Col>
        </Row>
      </Container>
    </footer>
  );
}

export default Footer;
